import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBook, faFileAlt, faHome, faUniversity } from '@fortawesome/free-solid-svg-icons';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className="bg-blue-600 text-white p-4 shadow-md">
      <div className="flex justify-between items-center max-w-7xl mx-auto">
        <h1 className="text-2xl font-bold">
          <FontAwesomeIcon icon={faUniversity} className="mr-2" />
          Academic Resource Management System
        </h1>
        <ul className="flex gap-4">
          <li><Link to="/" className="hover:underline">Home</Link></li>
          <li><Link to="/departments" className="hover:underline">Departments</Link></li>
          <li>
            <Link to="/university" className="hover:underline">University</Link></li>
          <li>
            <Link to="/contact" className="hover:underline">Contact Us</Link></li>
          <li>
            <Link to="/members" className="hover:underline">Special Members</Link></li>
          <li>
            <Link to="/admin" className="hover:underline">Admin Login</Link></li>
        </ul>
      </div>
    </nav>
  );
}
